import React from 'react';
import styled from 'styled-components';

const ChattingListBlock = styled.div`
  background: black;

  width: 800px;
  height: 600px;
`;

const ChattingList = () => {
  return <ChattingListBlock></ChattingListBlock>;
};

export default ChattingList;
